import React, { useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { adminApi, setAuthToken } from '../../api';
import { MDBBtn } from 'mdb-react-ui-kit';

const AdminDashboard = () => {
  const navigate = useNavigate();

  const handleOpenDoctorRegistration = () => {
    navigate('/doctor-registration');
  };

  const handleOpenUnverifiedUserList = () => {
    navigate('/admin/unverified-users');
  };

  const handleOpenAllDoctors = () => {
    navigate('/all-doctors');
  };

  useEffect(() => {
    setAuthToken();

    // Example: Fetch admin data
    adminApi
      .getData()
      .then((response) => {
        console.log('Admin data:', response.data);
      })
      .catch((error) => {
        console.error('Error fetching admin data:', error);
      });
  }, []);

  return (
    <div>
      <h1>Admin Dashboard</h1>
      <div className="d-grid gap-2">
        <MDBBtn onClick={handleOpenDoctorRegistration}>Doctor Registration</MDBBtn>
      </div>
      <div>
        <MDBBtn onClick={handleOpenUnverifiedUserList}>Unverified Users</MDBBtn>
      </div>
      <div>
        <MDBBtn onClick={handleOpenAllDoctors}>All Doctors</MDBBtn>
      </div>
      <Link to="/all-doctors-schedules-this-week">
        <MDBBtn>This Week Schedules</MDBBtn>
      </Link>
    </div>
  );
};

export default AdminDashboard;
